function App() {
  return (
    <div className="App">
      <div classname="datos">
        <label>Canal: <input type='text'/></label><br/>
        <label>Frecuencia: <input type='text'/></label><br/>
        <label>Modo: <input type='text'/></label><br/>
        <label>Uso: <input type='text'/></label><br/>
        <button>Registrar</button>
      </div>h
    </div>
  );
}

export default App;
